5	<p style="text-align:justify"><strong><span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif">Основатель дизайн- студии Freedom Group Владислав Попов</span></span></strong></p>\r\n\r\n<p style="text-align:justify">&nbsp;</p>\r\n\r\n<p style="text-align:justify"><span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif">Возможно, вы не знакомы с Владиславом лично, но все, что можно увидеть на первом этаже &laquo;Космопарка&raquo;, дизайн для зала IMAX,&nbsp;&nbsp;</span></span><span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif">офиса &laquo;Кумтор&raquo;; на руднике, ресторана &laquo;Ала-Тоо&raquo;, фасады проектов Elite House - &laquo;Итальянский Квартал&raquo;, Nova City, New York, чайхана &laquo;Нават&raquo; на Южной Магистрали и проекты для домов первых лиц Кыргызстана -&nbsp;</span></span><span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif">работа его команды. Изначально ребята занимались только дизайном, но спустя время, пришлось найти партнеров среди ремонтников, потому что не&nbsp;</span></span><span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif">все строители могут воплотить в реальность задуманное дизайнером.&nbsp;</span></span><span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif">Спустя время выяснилось, что заказчикам мало хорошего дизайна, они хотят еще качественную мебель.&nbsp;</span></span><span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif">В итоге, компания Влада проектирует дома начиная от дизайна ландшафта и фасада, заканчивая установкой мебели. Все проекты &laquo;под ключ&raquo; въезжай и живи.</span></span></p>	67
